  border-color: #999;
  min-height: 24px;
  padding: 3px;
  border-radius: 2px;
}
.btn {
  font-family: "Segoe UI", "Segoe UI Variable", -apple-system, system-ui, BlinkMacSystemFont, "Segoe UI", Roboto, "Helvetica Neue", Arial, sans-serif;
  padding: 4px 18px;
  text-align: center;
  background-color: #117865;
  color: #fff;
  transition: color 0.2s, background-color 0.2s, border-color 0.2s;
  border-radius: 4px;
  font-weight: 600;
  appearance: none;
  border: none;
  cursor: pointer;
  font-size: 14px;
  line-height: 1.5;
  text-decoration: none;
  display: inline-block;
  border: 1px solid #117865;
}
.btn:before {
  font-size: 13px;
  margin-right: 5px;
}
.btn:not(.disabled):hover {
  background-color: #0e6252;
  border-color: #0e6252;
  color: #e6e6e6;
}
.btn:not(.disabled):active {
  background-color: #041f1a;
  border-color: #0e6252;
  color: #cccccc;
}
