  background-color: #ccc;
  color: #444;
  border-color: #ccc !important;
}
.btn.alt:hover {
  background-color: #b3b3b3;
}
.btn.alt:active {
  background-color: #999999;
}
.btn.alt2 {
  background-color: #fff;
