:root {
  --litepicker-day-color: #444 !important;
  --litepicker-is-in-range-color: #FFF8D5 !important;
  --litepicker-is-start-color: #000 !important;
  --litepicker-is-end-color: #000 !important;
  --litepicker-is-end-color-bg: #F2C910 !important;
  --litepicker-day-color-hover: #000 !important;
  --litepicker-button-next-month-color-hover: #000 !important;
  --litepicker-button-prev-month-color-hover: #000 !important;
}
.litepicker .container__months {
  box-shadow: 0 0 8px rgba(102, 102, 102, 0.2) !important;
  border-radius: 0 !important;
  border: 1px solid #dedede;
  width: calc(var(--litepicker-month-width) + 20px) !important;
}
.litepicker .container__months .month-item {
  padding: 0 10px 10px 10px !important;
}
.litepicker .container__months .month-item select {
  font-family: 'Segoe UI', wf_segoe-ui_normal, helvetica, arial, sans-serif;
  font-size: 15px;
  color: #4d4d4d;
  opacity: 0.8;
  border: none;
}
.litepicker .container__months .month-item .button-next-month,
.litepicker .container__months .month-item .button-previous-month {
  font-family: 'icons';
  font-style: normal;
  text-align: center;
  font-size: 15px;
  line-height: 1.5;
  cursor: pointer;
}
.litepicker .container__months .month-item .button-next-month svg,
.litepicker .container__months .month-item .button-previous-month svg,
.litepicker .container__months .month-item .button-next-month img,
.litepicker .container__months .month-item .button-previous-month img {
  display: none;
}
.litepicker .container__months .month-item .button-next-month.button-next-month:after,
.litepicker .container__months .month-item .button-previous-month.button-next-month:after {
  content: '\e76c';
}
.litepicker .container__months .month-item .button-next-month.button-previous-month:after,
.litepicker .container__months .month-item .button-previous-month.button-previous-month:after {
  content: '\e76b';
}
.litepicker .container__days .day-item {
  border-radius: 0 !important;
  cursor: pointer;
}
.litepicker .container__days .day-item:hover {
  background-color: #f2f2f2;
  box-shadow: none !important;
}
.litepicker .container__days .day-item.is-in-range {
  cursor: default !important;
}

.wizard {
  position: absolute;
  left: 0;
  top: 0;
  right: 0;
  bottom: 0;
  pointer-events: all;
  z-index: 99999999;
  cursor: default;
  background: rgba(255, 255, 255, 0.85);
  display: flex;
  align-items: center;
  justify-content: center;
}
.wizard .wizard-action {
  padding: 25px 20px;
  background: #fff;
  box-shadow: 0 0 7px 1px rgba(0, 0, 0, 0.2);
  border: 1px solid #ccc;
  text-align: center;
  display: flex;
  max-width: 350px;
}
.wizard .wizard-action .step {
  padding: 0 20px;
  display: flex;
  flex-direction: column;
  flex: 0 1 50%;
  align-items: center;
  justify-content: flex-start;
}
.wizard .wizard-action .step:first-child {
  border-right: 2px dashed #eee;
}
.wizard .wizard-action .step .step-no {
  border-radius: 100%;
  font-size: 12px;
  line-height: 1.4;
  width: 26px;
  height: 26px;
  font-weight: bold;
  display: flex;
  align-items: center;
  justify-content: center;
  border: 1px solid #bbb;
  color: #222;
  margin: 0 0 10px 0;
  box-shadow: 0 0 3px 0 rgba(0, 0, 0, 0.2);
}
.wizard .wizard-action .step .step-no.completed {
  background: #08aa08;
  color: #fff;
  border-color: transparent;
}
.wizard .wizard-action .step .step-no.completed:before {
  font-size: 14px;
  line-height: 1;
}
.wizard .wizard-action .step .step-no.completed span {
  display: none;
}
.wizard .wizard-action .required-fields {
  font-size: 15px;
  margin-top: 4px;
  white-space: nowrap;
  color: #999;
}
.wizard .wizard-action .show-wizard {
  white-space: nowrap;
}
.wizard .wizard-action .close-wizard {
  position: absolute;
  top: 0;
  right: 0;
  font-size: 12px;
  line-height: 1.3;
}
.wizard .wizard-action .close-wizard:before {
  font-size: 12px;
  margin: 0;
}
.okviz-wizard .step-content .step-section {
  width: 100%;
  margin: 10px 0;
}
.okviz-wizard .step-content .step-cols {
  display: flex;
}
.okviz-wizard .step-content .step-cols .step-section {
  flex: 0 1 45%;
  margin: 10px 0 20px 30px;
}
.okviz-wizard .step-content .step-cols .step-section:first-child {
  margin-left: 0;
}
.okviz-wizard .step-content .welcome {
  font-size: 17px;
  color: #999;
  line-height: 1.5;
  margin: 0 10px 40px 10px;
}
.okviz-wizard .step-content .bottom-note {
  margin-top: 20px;
}
.okviz-wizard .step-content .top-note {
  margin-bottom: 20px;
}
.okviz-wizard .step-content .leap-desc {
  margin-top: 30px;
}
.okviz-wizard .step-content select {
  height: auto;
}
.okviz-wizard .step-content .step-section-title {
  margin: 0 0 10px 0;
}
.okviz-wizard .step-content .step-text {
  margin-top: 17px;
  font-size: 14px;
}
.okviz-wizard .step-content .options-block {
  display: flex;
  flex-wrap: wrap;
  width: 100%;
}
.okviz-wizard .step-content .options-block .option-value {
  font-size: 14px;
  margin: 5px;
  padding: 5px;
  border: 2px solid transparent;
  background-color: #fff;
  box-shadow: 0 0 7px 0 rgba(0, 0, 0, 0.2);
  transition: background-color 0.2s, border-color 0.2s;
  cursor: pointer;
  display: flex;
  flex-direction: column;
  align-items: center;
  justify-content: center;
}
.okviz-wizard .step-content .options-block .option-value:hover {
  border-color: #ccc;
  background-color: #f0f0f0;
}
.okviz-wizard .step-content .options-block .option-value:active {
  background-color: #e0e0e0;
}
.okviz-wizard .step-content .options-block .option-value.active {
  border-color: #f2c811;
}
.okviz-wizard .step-content .options-block .option-value .option-image {
  display: flex;
  flex-direction: column;
  align-items: center;
  justify-content: center;
  width: 100%;
  padding: 65px 10px 15px 10px;
  background-repeat: no-repeat;
  background-size: 95px 45px;
  background-position: center 15px;
}
.okviz-wizard .step-content .options-block .option-value .option-image.big {
  background-size: 127px 72px;
  padding-top: 90px;
}
.okviz-wizard .step-content .options-block.block1 .option-value {
  width: 100%;
}
.okviz-wizard .step-content .options-block.block2 .option-value {
  width: calc(50% - 25px);
}
.okviz-wizard .step-content .options-block.block3 .option-value {
  width: calc(33% - 25px);
}
.okviz-wizard .step-content .options-block.block4 .option-value {
  width: calc(25% - 25px);
}
.okviz-wizard .step-content .options-block.block5 .option-value {
  width: calc(20% - 25px);
}
.okviz-wizard .step-content .options-block.block6 .option-value {
  width: calc(16% - 21px);
}
.okviz-wizard .step-content .options-block.block7 .option-value {
  width: calc(13% - 17px);
}
.okviz-wizard .step-content .templates-toolbar {
  margin-top: 0 !important;
